                `,list:{title:"Benefit:",icons:[{id:0,title:"Reduced GHG emissions",url:"icon-modal-2",alt:"Reduced GHG emissions"}]}},{id:[1,7],title_annotation:"One Five One",title:"A BRIGHTER FUTURE WITH SOLAR POWER",video:"/videos/Solar.mp4",button:{title:"Learn more",link:"https://dairyfarmersofcanada.ca/en/sustainability/renewable-energy"},description:`
